INSERT INTO `knowledge` VALUES (1,'日常防火的常识 ','1．养成良好习惯，不要随意乱仍未熄灭的烟头和火种，不能在酒后、疲劳状态和临睡前在床上和沙发上吸烟。 \r\n2、夏天点蚊香应放在专用的架台上，不能靠近窗帘、蚊帐等易燃物品。 \r\n3．不随意存放汽油、酒精等易燃易爆物品，使用时要加强安全防护。 \r\n4．使用明火要特别小心，火源附近不要放置可燃、易燃物品。 \r\n5．焊割作业火灾危险大，作业前要清楚附近易燃可燃物，作业前要清除附近易燃可燃物，作业中要有专人监护，防范高温焊屑飞溅引发火灾，作业后要检查是否遗留火种。 \r\n6．发现煤气泄漏，速关阀门，打开门窗，切勿触动电器开关盒使用明火，并迅速通知专业维修部门来处理。 \r\n7．要经常检查电气线路，防止老化、短路、漏电等情况，电器线路破旧老化要及时修理更换。 \r\n8．电路保险丝（片）熔断，切勿用铜线铁线代替，提倡安装自动空气开关。 \r\n9．不能超负荷用电，不乱拉乱接电线。 \r\n10．离开住处或睡觉前要检查用电器具是否断电，总电源是否切断，燃气阀门是否关闭，明火是否熄灭。 \r\n11、切勿在走廊、楼梯口、消防通道等处堆放杂物，要保证通道和',0,0),(2,'火灾现场的逃生自救 ','火灾发生有很大的偶然性，一旦火灾降临，在浓烟毒气和烈焰包围下，不少人葬身火海，但也有人死里逃生幸免于难。面对滚滚浓烟和熊熊烈焰，只要冷静机智运用火场自救与逃生知识，就有极大可能拯救自己。因此，掌握多一些火场自救的要诀，险境中也许就能获得第二次生命。  \r\n第一：逃生预演，临危不乱。  \r\n每个人对自己工作，学习或居住所在的建筑物的结构及逃生路径要做到了然于胸，必要时可集中组织应急逃生预演，使大家熟悉建筑物内的消防设施及自救逃生的方法。这样，火灾发生时，就不会觉得走投无路了。',0,0),(3,'火灾自救 常识',' (1)扑救火灾要力所能及,若火势无法控制,就要设法采取自救的措施,  \r\n保护生命.  \r\n      (2)保持清醒的头脑,弄清自己的位置和周围的安全通道路线.  \r\n      (3)不要为了顾及财物延误了自救时机.  \r\n      (4)火灾造成的烟雾比空气轻,浮在上层,所以在通过烟雾区时应尽  \r\n量弯腰或爬行.  \r\n      (5) 如果被困在火场之中无法通过疏散通道逃离时,可以用两种方法  \r\n自救,一是采取适当的防护措施强行穿过火场,如用浸湿的面被或毛毯等   \r\n物裹在身上;二是栓上绳索,沿绳索下滑到楼下(若无绳索可利用其他物  \r\n品采取类似方法逃离) ',0,0),(4,'消防器材使用','一般的燃烧物质都可以用水扑灭，但水能导电，因此电气火灾不 \r\n \r\n能用水来扑救．泡沫灭火剂主要用于扑救在水中不能溶解的可燃液体  \r\n及一般固体火灾.普通干粉灭火剂主要用于扑救可燃液体火灾,可燃气体  \r\n火灾和带电设备火灾,二氧化碳 灭火剂适合于扑救可燃液体火灾.',0,0),(5,'消防器材的维护 ','消防器材平时要维护好,不能将其挪作他用,保持完好,在消防器材  \r\n附近不能放置杂物,以免被遮挡或在紧急情况下不能及时取用.定时对生  \r\n产场所的各消防器材进行例行检查,如发现坏损或逾期时应及时上报以  \r\n便立即处理.',0,0);

