# Structure for table "fire_alarm_view"
#

DROP VIEW IF EXISTS `fire_alarm_view`;
CREATE VIEW `fire_alarm_view` AS 
  select `alarm`.`ID` AS `ID`,`alarm`.`CONCENTRATOR_ID` AS `CONCENTRATOR_ID`,`alarm`.`OBJ_TYPE` AS `OBJ_TYPE`,`alarm`.`OBJ_ID` AS `OBJ_ID`,`alarm`.`ALARM_TYPE` AS `ALARM_TYPE`,`alarm`.`ALARM_TIME` AS `ALARM_TIME`,`alarm`.`CLEAR_STATUS` AS `CLEAR_STATUS`,`alarm`.`DATA_VALUE` AS `DATA_VALUE`,`alarm`.`CLEAR_USER` AS `CLEAR_USER`,`alarm`.`CLEAR_TIME` AS `CLEAR_TIME`,`concentrator`.`STATUS` AS `STATUS`,`concentrator`.`DESCRIPTION` AS `CONCENT_DESP`,`concentrator`.`CONCENTRATOR_KIND` AS `CONCENTRATOR_KIND`,`fire_sensor`.`MACHINE_ID` AS `MACHINE_ID`,`fire_sensor`.`LOOP_ID` AS `LOOP_ID`,`fire_sensor`.`CODE_ID` AS `CODE_ID`,`fire_sensor`.`LOCATION_DESP` AS `LOCATION_DESP`,`fire_sensor`.`LOCATION_X` AS `LOCATION_X`,`fire_sensor`.`LOCATION_Y` AS `LOCATION_Y`,`fire_sensor`.`PLAN_NODE_ID` AS `PLAN_ID`,`fire_sensor`.`SENSOR_TYPE` AS `SENSOR_TYPE`,`fire_sensor`.`SENSOR_TYPE_NAME` AS `SENSOR_TYPE_NAME`,`fire_sensor`.`CONTACTS` AS `CONTACTS`,`fire_sensor`.`CONTACT_PHONE` AS `CONTACT_PHONE`,`alarm_type`.`TYPE_NAME` AS `ALARM_TYPE_NAME`,`alarm_type`.`KIND` AS `KIND`,`alarm_type`.`PUSH_TYPE` AS `PUSH_TYPE`,`company`.`COMPANY_NAME` AS `COMPANY_NAME`,`company`.`org_id` AS `org_id` from ((((`alarm` left join `concentrator` on((`alarm`.`CONCENTRATOR_ID` = `concentrator`.`CONCENTRATOR_ID`))) left join `fire_sensor` on(((`alarm`.`CONCENTRATOR_ID` = `fire_sensor`.`CONCENTRATOR_ID`) and (`alarm`.`OBJ_ID` = `fire_sensor`.`MACHINE_ID`) and (`alarm`.`OBJ_ID1` = `fire_sensor`.`LOOP_ID`) and (`alarm`.`OBJ_ID2` = `fire_sensor`.`CODE_ID`)))) left join `alarm_type` on((`alarm`.`ALARM_TYPE` = `alarm_type`.`TYPE_ID`))) left join `company` on((`alarm`.`CONCENTRATOR_ID` = `company`.`CONCENTRATOR_ID`))) where (`concentrator`.`CONCENTRATOR_KIND` = 4);

